import React from "react";
import "./modal.scss";
import Carousel from "../carousel/carousel"
import { withScriptjs } from "react-google-maps";
import Map from '../map/directions';


const Modal = (props) => {
    debugger
    if (!props.modal){
        return null
    }
    const MapLoader = withScriptjs(Map);
    let studyPalCafe = props.data.studyPalCafe;
    
    const carouselModal = (
      <div className="carousel-modal" onClick={(e) => e.stopPropagation()}>
        <div className="carousel-container">
          <Carousel photos={props.data.yelpData.photos} />
        </div>
        <div className="business-misc">This Business Has Been Rolled:</div>
        <Map cafe_lat = {props.data.yelpData.coordinates.latitude} 
        cafe_lng = {props.data.yelpData.coordinates.longitude}/>
      </div>
    );


    return (
    
        <div className="modal-backdrop" onClick={props.closeModal}>
            {carouselModal}
        </div>

    );


}


export default Modal;
